import logo from './logo.svg';
import React, { useState } from 'react';
import './App.css';
import Header from './assets/components/header';

function App() {
    return (
        <>
          <ThemeProvider>
            <Root>
              <Header />
              <Routes>
                <Route path="/" element={<Header />} />
              </Routes>
            </Root>
          </ThemeProvider>
        </>
      )
    }
    
    export default App
